text:
Что я делаю, когда мне нужно готовиться к экзаменам:
10% - учу;
90% - говорю всем, что мне нужно готовиться к экзаменам.

два факта о девушках:
1. они часто находятся в плохом настроении;
2. и в этом всегда виноват ты.

Столетие — 100 лет;
Декада — 10 лет;
Пятилетие — 5 лет;
Вечная любовь — 2 недели;
Твоя диета — 1 день.

План действий на завтра:
1. Проебать день;
2. Лечь спать.

Столетие — 100 лет;
Декада — 10 лет;
Пятилетие — 5 лет;
Вечная любовь — 2 недели;
Твоя диета — 1 день.
